Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

# Define the UI elements
$Form = New-Object System.Windows.Forms.Form
$Form.Text = "File Hash Tool"
$Form.ClientSize = New-Object System.Drawing.Size(400, 220)
$Form.FormBorderStyle = [System.Windows.Forms.FormBorderStyle]::None
$Form.StartPosition = [System.Windows.Forms.FormStartPosition]::CenterScreen
$Form.BackColor = "#EEEEEE"
$Form.Padding = New-Object System.Windows.Forms.Padding(10)


$iconBase64      = ''
$iconBytes       = [Convert]::FromBase64String($iconBase64)
# initialize a Memory stream holding the bytes
$stream          = [System.IO.MemoryStream]::new($iconBytes, 0, $iconBytes.Length)
$Form.Icon       = [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::new($stream).GetHIcon()))








$CloseButton = New-Object System.Windows.Forms.Button
$CloseButton.Location = New-Object System.Drawing.Point(365, 0)
$CloseButton.Size = New-Object System.Drawing.Size(35, 35)
$CloseButton.FlatStyle = "Flat"
$CloseButton.FlatAppearance.BorderSize = 0
$CloseButton.BackColor = "#00FF5252"
$CloseButton.ForeColor = "#AAAAAA"
$CloseButton.Font = New-Object System.Drawing.Font("Arial", 14, [System.Drawing.FontStyle]::Regular)
$CloseButton.Text = "X"
$CloseButton.Add_Click({
    $Form.Close()
})

$MinimizeButton = New-Object System.Windows.Forms.Button
$MinimizeButton.Location = New-Object System.Drawing.Point(330, 0)
$MinimizeButton.Size = New-Object System.Drawing.Size(35, 35)
$MinimizeButton.FlatStyle = "Flat"
$MinimizeButton.FlatAppearance.BorderSize = 0
$MinimizeButton.BackColor = "#002196F3"
$MinimizeButton.ForeColor = "#AAAAAA"
$MinimizeButton.Font = New-Object System.Drawing.Font("Arial", 14, [System.Drawing.FontStyle]::Regular)
$MinimizeButton.Text = "_"
$MinimizeButton.Add_Click({
    $Form.WindowState = [System.Windows.Forms.FormWindowState]::Minimized
})

$Button1 = New-Object System.Windows.Forms.Button
$Button1.Location = New-Object System.Drawing.Point(20, 50)
$Button1.Size = New-Object System.Drawing.Size(360, 40)
$Button1.FlatStyle = "Flat"
$Button1.FlatAppearance.BorderSize = 0
$Button1.BackColor = "#2196F3"
$Button1.ForeColor = "White"
$Button1.Font = New-Object System.Drawing.Font("Arial", 12, [System.Drawing.FontStyle]::Regular)
$Button1.Text = "Select File"
$Button1.Add_Click({
    $OpenFileDialog = New-Object System.Windows.Forms.OpenFileDialog
    $OpenFileDialog.Title = "Select a file"
    $OpenFileDialog.Filter = "All Files (*.*)|*.*"
    If ($OpenFileDialog.ShowDialog() -eq [System.Windows.Forms.DialogResult]::OK) {
        $FilePath = $OpenFileDialog.FileName
        $Label2.Text = "File: " + $FilePath
        $md5 = New-Object System.Security.Cryptography.MD5CryptoServiceProvider
        $sha1 = New-Object System.Security.Cryptography.SHA1CryptoServiceProvider
        $FileStream = New-Object System.IO.FileStream($FilePath, [System.IO.FileMode]::Open)
        $md5hash = [System.BitConverter]::ToString($md5.ComputeHash($FileStream)).Replace("-", "").ToLower()
        $sha1hash = [System.BitConverter]::ToString($sha1.ComputeHash($FileStream)).Replace("-", "").ToLower()
        $Label3.Text = "MD5: " + $md5hash
        $Label4.Text = "SHA-1: " + $sha1hash
        $FileStream.Close()
}})

$Label2 = New-Object System.Windows.Forms.Label
$Label2.Location = New-Object System.Drawing.Point(20, 110)
$Label2.Size = New-Object System.Drawing.Size(360, 50)
$Label2.Font = New-Object System.Drawing.Font("Arial", 10, [System.Drawing.FontStyle]::Regular)
$Label2.TextAlign = [System.Drawing.ContentAlignment]::TopLeft

$Label3 = New-Object System.Windows.Forms.Label
$Label3.Location = New-Object System.Drawing.Point(20, 160)
$Label3.Size = New-Object System.Drawing.Size(360, 30)
$Label3.Font = New-Object System.Drawing.Font("Arial", 10, [System.Drawing.FontStyle]::Regular)
$Label3.TextAlign = [System.Drawing.ContentAlignment]::TopLeft

$Label4 = New-Object System.Windows.Forms.Label
$Label4.Location = New-Object System.Drawing.Point(20, 190)
$Label4.Size = New-Object System.Drawing.Size(360, 30)
$Label4.Font = New-Object System.Drawing.Font("Arial", 10, [System.Drawing.FontStyle]::Regular)
$Label4.TextAlign = [System.Drawing.ContentAlignment]::TopLeft

$Form.Controls.Add($CloseButton)
$Form.Controls.Add($MinimizeButton)
$Form.Controls.Add($Button1)
$Form.Controls.Add($Label2)
$Form.Controls.Add($Label3)
$Form.Controls.Add($Label4)

$Form.ShowDialog() | Out-Null